// activation.component.ts
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { InitialConfigService } from 'src/app/core/services/initial-config.service';

@Component({
  selector: 'app-activation',
  templateUrl: './activation.component.html',
  styleUrls: ['./activation.component.css']
})

export class ActivationComponent implements OnInit {
  activationForm: FormGroup = this.formBuilder.group({
    password: ['', [Validators.required, Validators.minLength(8)]],
    confirmPassword: ['', [Validators.required]]
  });
  token: string = '';

  constructor(
    private route: ActivatedRoute,
    private formBuilder: FormBuilder,
    private _initialConfigService: InitialConfigService
  ) { }

  ngOnInit(): void {
    this.token = this.route.snapshot.paramMap.get('token')!;
    this.activationForm = this.formBuilder.group({
      password: ['', [Validators.required, Validators.minLength(8)]],
      confirmPassword: ['', [Validators.required]]
    });
    // Agrega validaciones adicionales según sea necesario
  }

  onActivate() {
    // if (this.activationForm.valid) {
    //   this._initialConfigService.activateAccount(this.token, this.activationForm.value.password).subscribe(
    //     response => {
    //       // Maneja la respuesta
    //     },
    //     error => {
    //       // Maneja los errores
    //     }
    //   );
    // }
  }
}
<form [formGroup]="activationForm" (ngSubmit)="onActivate()">
    <div class="row gx-3 mb-3">
        <!-- Form Group (first name)-->
        <div class="col-md-6">
            <label class="small mb-1" for="inputPassword">Password</label>
            <input class="form-control" id="inputPassword" type="password" placeholder="Enter password"
                formControlName="inputPassword"
                [ngClass]="{'is-invalid': activationForm.get('inputPassword')?.invalid && (activationForm.get('inputPassword')?.dirty || activationForm.get('inputPassword')?.touched)}" />
            <div *ngIf="activationForm.get('inputPassword')?.invalid && (activationForm.get('inputPassword')?.dirty || activationForm.get('inputPassword')?.touched)"
                class="text-danger">
                <span *ngIf="activationForm.get('inputPassword')?.errors?.['required']">
                    Password is required.
                </span>
                <span *ngIf="activationForm.get('inputPassword')?.errors?.['minlength']">
                    Password must be at least 3 character long.
                </span>
                <span *ngIf="activationForm.get('inputPassword')?.errors?.['maxlength']">
                    Password must be no more than 25 characters long.
                </span>
                <span *ngIf="activationForm.get('inputPassword')?.errors?.['mustMatch']">
                    Passwords must match
                </span>
            </div>
        </div>
        <!-- Form Group (last name)-->
        <div class="col-md-6">
            <label class="small mb-1" for="inputConfirmPassword">Confirm Password</label>
            <input class="form-control" id="inputConfirmPassword" type="password" placeholder="Confirm password"
                formControlName="inputConfirmPassword"
                [ngClass]="{'is-invalid': activationForm.get('inputConfirmPassword')?.invalid && (activationForm.get('inputConfirmPassword')?.dirty || activationForm.get('inputConfirmPassword')?.touched)}" />
            <div *ngIf="activationForm.get('inputConfirmPassword')?.invalid && (activationForm.get('inputConfirmPassword')?.dirty || activationForm.get('inputConfirmPassword')?.touched)"
                class="text-danger">
                <span *ngIf="activationForm.get('inputConfirmPassword')?.errors?.['required']">
                    Confirm Password is required.
                </span>
                <span *ngIf="activationForm.get('inputConfirmPassword')?.errors?.['minlength']">
                    Confirm Password must be at least 3 character long.
                </span>
                <span *ngIf="activationForm.get('inputConfirmPassword')?.errors?.['maxlength']">
                    Confirm Password must be no more than 25 characters long.
                </span>
                <span *ngIf="activationForm.get('inputConfirmPassword')?.errors?.['mustMatch']">
                    Passwords must match.
                </span>
            </div>
        </div>
    </div>
    <button class="btn btn-primary" type="submit">Activate account</button>
</form>
